import React from "react";

import Parent_component_title_page from "./TItle page/Parent_component_title_page";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import SignIn from "./sign_in";
import SignUp from "./sign_up";


function App() {
  return (
    <Router>
    <div >
     <Routes>   
       <Route exact path="/">
        <Parent_component_title_page/>
        </Route>
        <Route exact path="/signin">
          <SignIn/>
        </Route>
        <Route exact path="/signup">
          <SignUp/>
        </Route>

     </Routes>

    </div>

    </Router>

  );
}

export default App;
